import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import { faHome, faSignInAlt, faSignOutAlt, faUserMd } from '@fortawesome/free-solid-svg-icons'
import './Navbar.css'
import {Link} from 'react-router-dom'
import { useState } from 'react'
import {Button, Form} from 'react-bootstrap'
import Modal from 'react-modal';
import LoginModal from '../Modals/LoginModal'
import SignupModal from '../Modals/SignupModal' 

const Navbar = () => {
    const [isLogged, setIsLogged] = useState(null)
    const [isLoginOpen,setIsLoginOpen] = useState(false);
    const [isSignupOpen,setIsSignupOpen] = useState(false);

    const openLogin = () => {
        setIsLoginOpen(true)
    }
    const closeLogin = () => {
        setIsLoginOpen(false)
    }
    const openSignup = () => {
        setIsSignupOpen(true)
    }
    const closeSignup = () => {
        setIsSignupOpen(false)
    }

    const modalStyle = {
        overlay: {
            backgroundColor     : '#2b1d13a0'
        },
        content : {
          borderRadius          : '13px',
          border                : '1px solid black',
          backgroundColor       : '#997b66',
          top                   : '50%',
          left                  : '50%',
          right                 : 'auto',
          bottom                : 'auto',
          marginRight           : '-50%',
          transform             : 'translate(-50%, -50%)',
          display               : 'flex',
          flexDirection : 'column',
          justifyContent : 'center'
        }
      };

    return (
        <div className="nav-container">
            <ul className="nav-links-container">
                <Link to="/"> 
                    <li className="nav-links"><FontAwesomeIcon color='#ffc55a' icon={faHome} size="3x"/></li>
                </Link>
                    <li className="nav-links" onClick={openLogin}><FontAwesomeIcon color='#ffc55a' icon={faSignInAlt} size="3x"/></li>
                {isLogged && 
                    <li className="nav-links"><FontAwesomeIcon color='#ffc55a' icon={faSignOutAlt} size="3x"/></li>
                }
                {isLogged && <Link to='/'> 
                    <li className="nav-links"><FontAwesomeIcon color='#ffc55a' icon={faUserMd} size="3x"/></li>
                </Link>}
            </ul>

            <Modal
          isOpen={isLoginOpen}
          onRequestClose={closeLogin}
          style={modalStyle}
          contentLabel="Example Modal"
          closeLogin={closeLogin}
            >
                <LoginModal setIsLoginOpen={setIsLoginOpen} setIsSignupOpen={setIsSignupOpen}/>
            </Modal>
            <Modal
          isOpen={isSignupOpen}
          onRequestClose={closeSignup}
          style={modalStyle}
          contentLabel="Example Modal"
          closeLogin={closeSignup}
            >
                <SignupModal setIsLoginOpen={setIsLoginOpen} setIsSignupOpen={setIsSignupOpen}/>
            </Modal>
        </div>
    )
}

export default Navbar
